import React from "react";
import "./home.css";
import { MDBBtn } from "mdbreact";

export const Home = () => (
  <div class="bg">
    <div className="papa text-center">
      <div className="texto">
        <h2 className="h1 display-3">SafariCO</h2>
        <h3 className="h1 display-5">WILDest dreams come true!</h3>
        <hr className="my-2" />
        <p className="lead">
          <MDBBtn href="/book" color="primary">
            Book
          </MDBBtn>
        </p>
      </div>
    </div>
  </div>
);
